import "./App.css";
import NavBar from "./NavBar";
import React, { Component } from "react";
import News from "./News";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <Router>
        <div>
          <NavBar />
          <Routes>
          <Route
              path="/"
              element={<News key="general" pageSize={9} category="general"/>}
            />
            <Route
              path="/general"
              element={<News key="general" pageSize={9} category="general" />}
            />
            <Route
              path="/business"
              element={<News key="business" pageSize={9} category="business" />}
            />
            <Route
              path="/entertainment"
              element={
                <News
                  key="entertainment"
                  pageSize={9}
                  category="entertainment"
                />
              }
            />
            <Route
              path="/sports"
              element={<News key="sports" pageSize={9} category="sports" />}
            />
            <Route
              key="health"
              path="/health"
              element={<News pageSize={9} category="health" />}
            />
            <Route
              path="/science"
              element={<News key="science" pageSize={9} category="science" />}
            />
            <Route
              path="/technology"
              element={
                <News key="technology" pageSize={9} category="technology" />
              }
            />
          </Routes>
        </div>
      </Router>
    );
  }
}
